import React from 'react';
import './App.css';
//import $ from 'jquery';

const App = () => {
  return (
    <article className="App">
      <Header/>
      <Navigation/>
    </article>
  );
}

const Header = () => {
  const joukkue = "Huutoniemen Hoki";
  const lyhenne = "HH";
  return (
      <header className="App-header">
        <p>{lyhenne}</p>
        <h1>{joukkue}</h1>
      </header>
  );
}

const Navigation = () => {
  const setActive = (event) => {
    console.log(event.target.id);
  }
  return (
      <nav className="App-nav">
        <ul>
          <li id="1" className="active" onClick={setActive}>Pääsivu</li>
          <li onClick={setActive}>Ottelut</li>
          <li onClick={setActive}>Harjoitukset</li>
          <li onClick={setActive}>Pelaajat</li>
          <li onClick={setActive}>Tilastot</li>
        </ul>
      </nav>
  );
}

export default App;
